import '../style/Footer.css'
import FootItem from './FootItem';

function Footer() {

    const items = [
        { title: 'O firmie', points: ['Historia', 'Zespół', 'Dołącz do nas'] },
        { title: 'Kontakt', points: ['Telefon', 'Adres e-mail', 'Formularz kontaktowy'] },
        { title: 'Informacje', points: ['Polityka prywatności', 'Regulamin', 'FAQ'] }
    ];

    return (
        <footer>
                    {items.map((item, index) => (
                <FootItem key={index} title={item.title} points={item.points} />
            ))}
        </footer>
    );
}

export default Footer;
